 export const getHardware = async (hardware : string, page : number) => {


    let res = await fetch(`http://localhost:5000/api/${hardware}/${page}`);
    let data = await res.json();


    return data;
   }


// eslint-disable-next-line import/no-anonymous-default-export
   export default {
      getHardware,
   };
